import React from "react";

const InfoPanel = () => {
  return (
    <div className="info-panel-container">
      <h2>Personal Info</h2>
      <p>Here goes the personal information...</p>

      <h3>Gallery</h3>
      <p>Display some amazing pictures here!</p>

      <h4>Other Features</h4>
      <p>Add more content and features as needed.</p>
    </div>
  );
};

export default InfoPanel;
